The JEWISH REVIEW OF BOOKS is a quarterly print publication where leading writers and scholars discuss the newest books and ideas about religion, literature, culture, and politics, as well as fiction, poetry, and the arts.  According to the JRB's website: &quot;We are committed to the ideal of the thoughtful essay that illuminates as it entertains.&quot;

Launched in 2010 and edited by Abraham Socher, it is modeled after the venerable New York Review of Books.

